import axios from "axios";

const baseUrl = "https://localhost:44376/user/";

export const getUser = () => {
  var query = axios.get(baseUrl + "user");
  return query;
};
export const getUserById = (id) => {
  var query = axios.get(baseUrl + "user/ById/" + id);
  return query;
};

